class Dash1 extends StatefulWidget {
  @override
  Dash1State createState() => Dash1State();
}
class Dash1State extends State<Dash1> {
   String customerName = "";
  @override
  void initState() {

    getDashboardDetails();
    super.initState();
  }
  getDashboardDetails() async{

    SharedPreferences prefs = await SharedPreferences.getInstance();
     customerName = prefs.getString('Customer')??'';
    print("id value of the user $customerName");
  }

   Future<List<NotificationRes>> createLoginState(int custId) async {
     final response = await post(Uri.parse(
         'https://fgapi.digidisruptors.in/api/CustomerAPI/GetCustwiseTodaysNotification?custID=$custId'));
     print('https://fgapi.digidisruptors.in/api/CustomerAPI/GetCustwiseTodaysNotification?custID=$custId');

     if (response.statusCode == 200) {
       print(response.body);

       final parsed = json.decode(response.body).cast<Map<String, dynamic>>();
       return parsed
           .map<NotificationRes>((json) => NotificationRes.fromJson(json))
           .toList();

       /*final data = json.decode(response.body);
       print(data["Count"][0]);
       return data[0].count;*/
     } else {
       throw Exception('Failed to create album.');
     }
   }

  @override
